import React from 'react'
import { useRouter } from 'next/router'
import Login from '../components/pages/Login'

export default function Home() {
  const router = useRouter()

  console.log(router)
  return (
    (() => {
      switch (window.location.pathname) {
        case '/login':
          return <Login />
        default:
          return <h1>Masuk</h1>
      }
    })()
  )
}
